import React, { useState } from 'react';
import axios from 'axios';

export function Navbar() {

    const handleSignIn = (e) => {
        e.preventDefault();

        window.location='/';
    }


    return(
        <div style={{display: 'flex', justifyContent: 'space-between', marginBottom: '20px',paddingBottom: '15px', paddingTop: '20px', backgroundColor: 'aliceblue'}}>
            <h3 style={{marginLeft: '40px'}}>
                Notes
            </h3>
            <column>
                <input type='text' size='40' style={{borderStyle: 'solid',padding: '8px', borderTopLeftRadius: '20px', borderBottomLeftRadius: '20px'}} placeHolder='search'/>
                <button type='button' style={{borderStyle: 'solid', color: 'black', backgroundColor: 'LightSkyBlue', 
                            padding: '8px', borderTopRightRadius: '20px', borderBottomRightRadius: '20px',
                            borderTopLeftRadius: '0px', borderBottomLeftRadius: '0px', borderColor: 'LightSkyBlue'}}>Search</button>
            </column>
            <button type='submit' onClick={handleSignIn} style={{border: '0px',borderColor: 'LightSkyBlue',color: 'black', marginRight: '50px', backgroundColor: 'LightSkyBlue', padding: '6px', borderRadius: '10px'}}>Sign In</button>
        </div>
    );
}
